import React, {Component} from 'react';
import slash from './slash.jpg';
import './Dog.css';

class Dog extends Component {
    render() {
        return (
            <div className="Dog">
                <h1>Slash!</h1>
                <img src={slash}/>
            </div>
        );
    }
}

export default Dog;
